import { useState, useEffect} from "react";
import "./index.css";

const Header = () => {
    const [connected, setConnected] = useState(false);

    const handleMetamask = () =>{
        if(connected){
            //dissconnect from metamask from contract model
            setConnected(false)
        }
        else{
            //connect to metamask from contract model
            setConnected(true)
        }
    }

    useEffect(() => {}, [connected]);

    return(
        //!add align to the right!
        <div className="header" style={{bgcolor:"primary.main"}}>
        <button><img src="../UI/Button1.png"/></button>
        </div> 
    );
}

export default Header;
